class Like extends Component {
  constructor(props) {
    super(props);
    this.state = {
      liked: false,
    };
  }
  render() {
    return (
      <i className={"fa" + this.state.liked ? "r" : "s" + " fa-heart"}></i>
    );
  }
}

export default Like;
